import { MakerNav } from "../../component/Navbar/homeNav"
import './Myprinters.css';
import Web3 from "web3";
import { Link } from "react-router-dom";
//import { useNavigate } from "react-router-dom";
import { useEffect,useState} from "react";
import OnBoarding from "../../SmartContracts/OnBoarding/OnBoarding";

export default function MyPrinters(){

    //const navigate=useNavigate();
    const [printerList,setPr]=useState('');
    let result='';




    useEffect(()=>{
        async function getPrintersData(){
            const boarding=new OnBoarding();
            const web3=new Web3();
            let res =await boarding.getPrinters()
            res.forEach((value,key)=>{

                    result= 
                  <Link to="/" className="printer"><tr key={key}>
                        <td key={value.name+"name"}><p className="pInfo"> {web3.utils.toUtf8(value.name)} </p></td>
                        <td key={value.volume+"volume"}><p className="pInfo"> {value.volume}</p></td>
                        <td key={value.maxPrintTemperature}><p className="pInfo">  {value.maxPrintTemperature} </p></td>
                    </tr>  </Link>
            })
            setPr(result);


        };
        getPrintersData();
        },[result])

    return(
        <div>
             <MakerNav/>
            <div className="printerTable">
            <h1>My printers</h1>


            <table className="myPrinters">
                <tbody>
                    <tr>
                        <th>Name</th>
                        <th>Volume</th>
                        <th>Max printer temperature</th>
                    </tr>
                    {printerList} 
                </tbody> 
            </table>


            </div>

        </div>
    )
}








